function clojureFindDefinition() {
  var ed = this.aceEditor;
  var editorMorph = this;
  var browser = this.clojureGetMyBrowser();
  var clojure = Global.clojure;

  lively.lang.fun.composeAsync(

    // 1. get static information for the node at point
    function(n) {
      var query = clojure.StaticAnalyzer.createDefinitionQuery(
        ed.session.$ast||ed.getValue(), ed.getCursorIndex(),
        editorMorph.clojureGetNs());
      if (!query) return n("Cannot extract code entity.");
      else if (query.source.match(/^:/))
        return n("It's a keyword, no definition for it.");
      else n(null, query);
    },


    // 2. get the associated intern data and source of the ns the i is defined in
    function(query, n) {
      var file = browser && browser.namespaceData && browser.namespaceData[query.nsName].file;
      var opts = {
        env: clojure.Runtime.currentEnv(editorMorph),
        ns: query.nsName,
        addNsSource: !browser,
        file: file
      }

      clojure.Runtime.retrieveDefinition(
        query.source, query.nsName, opts,
        function(err, data) { n(err, query, data); });
    },

    // 3. opening new editor... this is only needed for clj sys browsers
    // function(query, data,n) {
    //   if (data.intern.ns !== query.nsName) {
    //     var editor = clojure.UI.showSource({
    //       title: data.intern.ns + "/" + data.intern.name,
    //       content: data.nsSource
    //     });
    //     if (data.defRange) scrollToAndSelect(editor, data.defRange);
    //   } else {
    //     if (data.defRange) scrollToAndSelect(editorMorph, data.defRange);
    //   }
    // },

    // ensure that the browser has the target's ns loaded
    function(query, data,n) {
      if (data.intern.ns in browser.namespaceData) return n(null,query,data);
      browser.cljFindUnlistedNamespaces(function(err) { n(err, query, data); });
    },

    // select the target
    function(query,data,n) {
      var nsName = data.intern.ns, targetName = data.intern.name;
      var nsData = browser.namespaceData[nsName];
      if (!nsData) return n("cannot load namespace " + nsName);
      var d = (nsData.interns || []).detect(function(d) { return d.name === targetName; });
      var hasSource = true; //d.source && !d.source.startsWith("Source not found");
      var isVisible = d['private'] !== "true" || editorMorph.get(/privateCheckbox/i).checked;

      if (d && isVisible && hasSource)
        browser.scheduleSelection(d.ns, d.name, n);
      else
        browser.scheduleSelection(d.ns, null, function(err) {
          if (err) return n(err);
          if (data.defRange) scrollToAndSelect(editorMorph, data.defRange);
          n();
        });
    }
  )(function(err) {
    if (err)
      return editorMorph.setStatusMessage("Error retrieving definition:\n" + err);
  });


  function scrollToAndSelect(editMorph, defRange) {
    editMorph.withAceDo(function(ed) {
      ed.selection.setRange({
        start: ed.idxToPos(defRange[0]),
        end: ed.idxToPos(defRange[1])}, true);
      setTimeout(function() { ed.centerSelection(); }, 100);
    });

  }
}

