function onKeyDown(evt) {
    var keys         = evt.getKeyString(),
        nsList       = this.get("nsList"),
        nsInternList = this.get("nsInternList"),
        ed           = this.get("CodeEditor"),
        metaEd       = this.get("metadataEditor"),
        handled      = false;


    // add-hoc key combos...
    if (this.maybeDoCommand) {
      if (keys === "Left") { this.historyBack(); handled = true; }
      if (keys === "Right") { this.historyForward(); handled = true; }
      if (keys === "O") { this.copyAndOpen(); handled = true; }
    }
    this.maybeDoCommand = false;
    if (keys === "Control-X") { this.maybeDoCommand = true; }

    switch (keys) {
        case "Alt-,": this.historyBack(); handled = true; break;
        case "Alt-H": this.narrowHistory(); handled = true; break;
        case "Alt-Shift-T": case "Alt-T": this.narrowNamespaceData(); handled = true; break;
        case "Alt-Up":
            if (ed.isFocused()) {
                if (nsInternList.selection) nsInternList.focus();
                else nsList.focus();
                handled = true;
            }
            break;
        case "Alt-Down":
            if (nsList.isFocused() || nsInternList.isFocused()) {
                ed.focus(); handled = true;
            }
            break;
        case "F1": nsList.focus();
                   if (nsList.selection) nsList.selectAt(nsList.selectedLineNo);
                   handled = true; break;
        case "F2": nsInternList.focus();
                   if (nsInternList.selection) nsInternList.selectAt(nsInternList.selectedLineNo);
                   handled = true; break;
        case "F3": metaEd.focus(); handled = true; break;
        case "F4": ed.focus(); handled = true; break;
        case "Shift-F6": this.setEditorListPanelRatio(this.getEditorListPanelRatio() <= .3 ? .4 : .1);  handled = true; break;
    }

    if (!handled) return $super(evt);
    evt.stop(); return true;
}

