function narrowSelection() {
    var self = this;
    Functions.composeAsync(
        function(next) {
            var candidates = self.get("nsList").getValues();
            lively.ide.tools.SelectionNarrowing.chooseOne(candidates, next);
        },
        function(candidate, next) {
            lively.bindings.once(self.get("nsInternList"), "selection", function() { next(); }, "call");
            self.get("nsList").setSelection(candidate);
        },
