function narrowNamespaceData(thenDo) {
    var self = this;

    lively.lang.fun.composeAsync(
        prepareCandidates,
        openNarrower
    )(thenDo || function() {});

    // -=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-

    function prepareCandidates(next) {
      // this.namespaceData["cheshire.factory"].interns[3].arglists
        var candidates = Object.values(self.namespaceData).reduce(function(candidates, ns) {
            var name = ns.name;
            return candidates
              .concat([{isListItem: true, string: ns.name, value: ns}])
              .concat((ns.interns||[]).map(function(intern) {
                return {
                    isListItem: true,
                    string: Strings.format("%s/%s %s %s",
                        intern.ns, intern.name,
                        intern.arglists ? intern.arglists
                          .map(printArgList).join(', ') : "",
                        intern.tag ? "(" + intern.tag + ")" : ""),
                    value: intern
                }
            }));
        }, []);
        next(null, candidates);
    }

    function printArgList(argList) {
      return "[" + argList.map(function(arg) {
       return typeof arg === "object" ?
        JSON.stringify(arg).replace(/"/g, "").replace(/,/g, " ") :
           String(arg);
      }).join(" ") + "]";
    }

    function openNarrower(candidates, next) {
        lively.ide.tools.SelectionNarrowing.getNarrower({
            name: "clojure.namespace.Browser",
            spec: {
              candidates: candidates,
              actions: [
                function select(c) {
                  if (c.interns || !c.ns) { self.saveScheduleSelection(c.name); }
                  else self.saveScheduleSelection(c.ns.trim(), c.name.trim());
                  if (c.private && !self.get("privateCheckBox").checked)
                    (function() {
                      self.get("CodeEditor").setStatusMessage(c.name + " is private. Enable private access to see the def.");
                    }).delay(.1);
                }]
            },
            reactivateWithoutInit: false,
            keepInputOnReactivate: true,
        });
    }
}

