function updateWithNsInternData(data, thenDo) {
    var self = this;
    var ed = this.get("CodeEditor");
    var metaEd = this.get("metadataEditor");

    self.setSaveToFilePossible(data && self.namespaceData[data.ns]);

    if (!data) { metaEd.textString = ""; ed.setNewContent(""); return typeof thenDo === 'function' && thenDo(); }

    var infoUpdated = false, sourceUpdated =false;

    ed.setTextMode("clojure");
    metaEd.setTextMode("text");

    Functions.composeAsync(
        printFunction,
        // printDoc,
        printFileLoc
        // printRest
    )([], data, function(err, parts, data) {
        var result = err ? String(err) : parts.join(' ');
        metaEd.textString = result;
        infoUpdated = true
    });

    lively.lang.fun.composeAsync(
        ensureSource,
        printSource
    )([], data, function(err, parts, data) {
        var result = err ? String(err) : parts.join('\n\n');
        ed.setNewContent(result);
        ed.markClean();
        sourceUpdated =true;
    });

    lively.lang.fun.waitFor(1000,
      function() { return sourceUpdated && infoUpdated; },
      function(timeout) { typeof thenDo === 'function' && thenDo(); })

    // -=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-

    function printFunction(parts, data, next) {
        var string = data.name ? Strings.format("%s/%s", data.ns, data.name) : "";
        next(null, parts.concat([string]), data);
    }

    function printDoc(parts, data, next) {
        next(null, parts.concat([data.doc || ""]), data);
    }

    function printFileLoc(parts, data, next) {
        var string = data.file ?
            Strings.format("[%s:%s:%s]", data.file, data.line, data.column) : "";
        next(null, parts.concat([string]), data);
    }

    function printRest(parts, data, next) {
        var fieldsToIgnore = ["ns", "name", "arglists", "doc", "file", "line", "column", "source"];
        var string = Object.keys(data).withoutAll(fieldsToIgnore)
            .filter(function(k) { return typeof data[k] === "string" ? data[k].trim() : true; })
            .map(function(k) { return k + ": " + (typeof data[k] === "string" ? data[k].trim() : JSON.stringify(data[k], null, 2)); })
            .join('\n');
        next(null, parts.concat([string]), data);
    }

    function ensureSource(parts, data, next) {
      if (data.source) return next(null, parts, data);
      ed.textString = "; loading..."
      self.cljFetchSourceFor(data.ns + "/" + data.name, function(err, source) {
        data.source = source;
        next(null, parts, data);
      });
    }

    function printSource(parts, data, next) {
        if (!data.ns || !data.name) return next(null, parts, data);
        next(null, parts.concat([data.source]), data);

        // self.cljFetchSourceFor(data.ns + "/" + data.name, function(err, source) {
        //     next(null, parts.concat([source]), data);
        // })
    }
}

