function updateNamespaceSource(thenDo) {
    var nsList = this.get("nsList");
    var ed = this.get("CodeEditor");
    var metaEd = this.get("metadataEditor");
    var sel = nsList.getSelection();
    var self = this;
    var nsData = self.namespaceData[sel];

    if (!nsData) return thenDo(new Error("Namespace " + sel + " not loaded"));

    lively.lang.fun.composeAsync(
      nsData.source && nsData.source !== "nil" ?
        function(n) { n(null, nsData.source); } :
        function(n) {
          ed.textString = "; loading..."
          self.cljGetNamespaceSource(sel, n);
        }
    )(function(err, src) {
