    });

    lively.lang.fun.composeAsync(
      nsData.file ? function(n) { n(null, nsData.file); } : this.cljFetchFileNameForNs.bind(this,sel)
    )(function(err, fn) {
      if (err) self.get("CodeEditor").setStatusMessage("Error retrieving filename for ns " + sel + "\n" + err);

      nsData.file = fn;
      updateMetadata(nsData);
      self.setSaveToFilePossible(err ? null : nsData);
