function historyRecordNavigation() {
    if (!this.recordNavigation) return;

    var minTimeBetweenNavigation = 800; // ms

    this.pendingNavigationHistory.push(this.historyGetNavigationState());
    var self = this;
    lively.lang.fun.debounceNamed(this.id + "clj-browser-recordNavigation",
      50, function() {
        var navItems = self.pendingNavigationHistory.reduce(function(hist, navItem) {
          var last = hist.last();
          if (last && (last.time - navItem.time < minTimeBetweenNavigation
                     || isEqual(last, navItem))) {
                       hist.pop();
                       navItem = lively.lang.obj.merge(last, navItem);
                     }
          return hist.concat([navItem])
        }, []);

        // cut-off is "in front of" the current nav item
        var cur = self.currentHistoryNavItem,
            idx = self.navigationHistory.indexOf(cur);

        if (cur && idx >-1) self.navigationHistory = self.navigationHistory.slice(0,idx+1);
        self.pendingNavigationHistory = [];
        self.navigationHistory.pushAll(navItems)
        self.currentHistoryNavItem = navItems.last();
self.historyPrint();
        // show(self.currentHistoryNavItem)
      })();

      function isEqual(histItem1, histItem2) {
        if (histItem1 == histItem2) return true;
        if (!histItem1 || !histItem2) return false;
        return histItem1.ns === histItem2.ns && histItem1.nsIntern === histItem2.nsIntern && String(histItem1.selection) === String(histItem2.selection);
      }
}

