    var code = lively.lang.string.format(
      '(some-> \'%s rksm.system-navigator.ns.filemapping/file-for-ns .getAbsolutePath)',
    nsName);

  this.doCljEval(code, {passError: true, requiredNamespaces: ["rksm.system-navigator.ns.filemapping"], resultIsJSON: false}, function(err, result) {
    if (result) result = result.replace(/^"|"$/g,"");
    if (!err && (!result || result === 'nil'))
      err = "No file for namespace " + nsName + " found";
    thenDo(err, result);
  });
}

