function createNamespaceInteractively(thenDo) {

  var self = this, nsName, classpath;
  var cwd = lively.shell.cwd();

  lively.lang.fun.composeAsync(
    askForNamespace,
    // askToCreateFile,
    findCurrentClasspathDirs,
    chooseClassPath,
    ensureFile,
    // loadFile,
    reload,
    function(n) {
      lively.lang.fun.waitFor(1200,
        function() { return self.get("nsList").getList().pluck("string").include(nsName); },
        function() { setTimeout(n, 100); });
    },
    select
  )(function(err) {
    if (err)
      self.get("CodeEditor").setStatusMessage(String(err), Global.Color.red);
    thenDo && thenDo(err);
  });

  // -=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-

  function askForNamespace(n) {
    $world.prompt("Please enter a namespace name:", function(input) {
      if (!input || input.match(/\s/)) return n(new Error("Not a valid namespace name " + input))
      nsName = input; n();
    }, {historyId: "clojure-browser-namespace-creation", input: "org.foo.bar"})
  }

  function findCurrentClasspathDirs(n) {
    var query = lively.lang.string.format(
      "(->> (rksm.system-navigator.ns.filemapping/classpath-dirs)\n"
    + "  (map #(.getCanonicalPath %))\n"
    + "  (filter #(re-find #\"^%s\" %))\n"
    + "  clojure.data.json/write-str)", cwd);
    Global.clojure.Runtime.doEval(query,
      {passError: true, resultIsJSON: true, requiredNamespaces: ["rksm.system-navigator.ns.filemapping", "clojure.data.json"]},
      function(err, result) { n(err, result); });
  }

  function chooseClassPath(existingClassPath, n) {
    if (!existingClassPath || !existingClassPath.length) return askForClassPath(n);
    $world.listPrompt("Please choose a classpath:", function(input) {
      if (!input) n(new Error("\nNo namespace created.\nNo classpath choosen."))
      else if (input === "custom classpath...") askForClassPath(n);
      else { classpath = input; n(); }
    }, existingClassPath.concat(["custom classpath..."]), null, pt(500,600));
  }

  function askForClassPath(n) {
    $world.prompt("Please enter a directory that should serve as the classpath:", function(input) {
      if (!input) return n(new Error("\nNo namespace created.\nNot a valid classpath: " + input))
      classpath = input; n();
    }, {
      historyId: "clojure-browser-namespace-file-creation",
      input: lively.lang.string.joinPath(cwd, "src/")
    });
  }

  function ensureFile(n) {
    var template =
      '(rksm.system-navigator.system-browser/create-namespace-and-file \'%s "%s")'
    var src = lively.lang.string.format(template, nsName, classpath);

    Global.clojure.Runtime.doEval(src,
      {passError: true, requiredNamespaces: ["rksm.system-navigator.system-browser"]},
      function(err, result) { n(err); });
  }

  // function loadFile(n) {
  //   Global.clojure.Runtime.loadFile(nsCode, filename, {}, function(err) { n(err); })
  // }

  function reload(n) { self.reload({}, function(err) { n(err); }); }

  function select(n) {
    self.saveScheduleSelection(nsName, null, function(err) { n(err); }); }
}

