function saveNsOrIntern(nsName, nsInternName, source, thenDo, noWarning) {
  var self = this,
      isInternSave = !!nsInternName,
      writeToFile = this.get("SaveToFileCheckBox").isChecked()
                 && this.get("SaveToFileCheckBox").get(/checkbox/i).isActive(),
      relPath = nsName.replace(/\./g, "/").replace(/-/g, "_") + ".clj",
      editor = this.get("CodeEditor"),
      ns = editor.clojureGetNs() || nsName,
      env = Global.clojure.Runtime.currentEnv(editor),
      nsData = this.namespaceData[nsName],
      intern = isInternSave ? (nsData.interns || []).detect(function(ea) {
        return ea.name === nsInternName; }) : null,
      code = lively.lang.string.format(
        '(rksm.system-navigator.system-browser/change-%s! \'%s "%s" %s %s)',
        isInternSave ? "def" : "ns",
        isInternSave ? ns + "/" + nsInternName : ns,
        source
          .replace(/\\/g, "__SLASH__")
          .replace(/"/g, '\\"')
          // .replace(/\\([^"])/g, '\\\\$1')
          // .replace(/\\"/g, '\\\\\\"')
          // .replace(/""/g, '\\"\\"')
          // .replace(/([^\\])"/g, '$1\\"')
          ,
          writeToFile, nsData.file ? ('"' + nsData.file + '"') : ""),
      opts = {env: env, ns: isInternSave ? ns : "user", passError: true, requiredNamespaces: ["rksm.system-navigator.system-browser"]};

  if (!noWarning && warnAboutSuspiciousData()) return;

  Global.clojure.Runtime.doEval(code, opts, function(err, evalResult) {

    lively.lang.fun.composeAsync(
        updateSelf,
        updateOthers
    )(function(err2) {
      if (err) self.showClojureError(err, "Error saving " + nsName);
      else if (err2) editor.setStatusMessage("Error updating editors: " + err2, Global.Color.red)
      else editor.setStatusMessage("Successfully saved " + nsName, Global.Color.green);
      thenDo && thenDo(err || err2);
    });
   });

  // -=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-

  function updateSelf(n) {
    editor.markClean();

// self.reload({namespaces: [ns]}, n);

    lively.lang.fun.composeAsync(
      self.cljFetchNamespaceData.bind(self, [ns]),
      function(nsData, n) {
        if (nsData && nsData[ns]) {
          if (!isInternSave) nsData[ns].source = source;
          self.namespaceData[ns] = nsData[ns];
        }
        n(null, nsData);
      },
      function(nsData, n) {
        if (!isInternSave) {
          self.updateNsInternList(n);
        } else {
          self.get("nsInternList").getList()
            .zip(self.namespaceData[ns].interns)
            .forEach(function(itemAndIntern) {
              itemAndIntern[0].value = itemAndIntern[1]; });
          n();
        }
      }

    )(n);

  }

  function updateOthers(n) {
// show("%o",self.namespaceData[ns].interns)
    self.informOtherClojureBrowsersAboutChange(
      nsName, isInternSave ? nsInternName : null, n);
  }

  function warnAboutSuspiciousData() {
    if (!isInternSave) return false;
    var msg;
    if (!intern) msg = "No intern data for " + nsInternName;
    else if (!intern.line) msg = "No namespace position info for " + nsInternName
    else if (intern.line == 1) msg = nsInternName + " will be mapped into the namespace " + nsName + " onto line 1.\nThis would overwrite a ns declaration and could lead to problems.\n(Reason for this might be that you evaluated " + nsInternName + " outside of the browser)";
    if (!msg) return false;
    $world.confirm(msg, function(input) {
      if (input) return self.saveNsOrIntern(nsName, nsInternName, source, thenDo, true);
      editor.setStatusMessage("Save canceled.");
    }, "Do you want to save anyway?")
    return true;
  }
}

