function saveScheduleSelection(nsName, nsInternOrName, force, thenDo) {
  if (typeof force === "function") {
    thenDo = force; force = false;
  }

  var self = this;

  var currentSel = this.currentHistoryNavItem

  var nsIntern = nsInternOrName && nsInternOrName.name ? nsInternOrName.name : nsInternOrName
  if (!self.get("CodeEditor").hasUnsavedChanges() || self._selectionUpdateInProgress
   || self.isSelected(nsName, nsIntern)) return self.scheduleSelection(nsName, nsInternOrName, force, thenDo);

  $world.confirm("There are unsaved changes, discard them?", function(input) {
    if (input) self.scheduleSelection(nsName, nsInternOrName, force, thenDo);
    else {
      var currentSelIdxNs = self.get("nsList").find(currentSel.ns);
      var currentSelIdxIntern = self.get("nsInternList").find(currentSel.nsIntern);
      var currentSelIdxIntern = -1;
      var internFound = self.get("nsInternList").getList().detect(function(ea, i) {
        currentSelIdxIntern = i; return ea.string === currentSel.nsIntern; })

      self.get("nsList").updateView(null, null, currentSelIdxNs !== 'undefined' ? [currentSelIdxNs] : []);
      self.get("nsInternList").updateView(null, null, internFound ? [currentSelIdxIntern] : []);
      thenDo && thenDo(new Error("User canceled selection change"));
    }
  });
}

