function onExternalChangeNsIntern(change, thenDo) {
  var intern = this.get("nsInternList").selection;
  if (!intern) return this.onExternalChangeNs(change, thenDo);
  if (!this.namespaceData[change.ns]) return thenDo && thenDo();

  this.namespaceData[change.ns] = lively.lang.obj.deepCopy(change.data);

  var internName = intern.name || intern;
  var newIntern = change.data.interns.detect(function(ea) { return ea.name === internName; });
  if (lively.lang.obj.equals(newIntern, intern)) return thenDo && thenDo();

  if (!this.get("CodeEditor").hasUnsavedChanges()) {
    this.scheduleSelection(intern.ns, internName, true)
  }
  thenDo && thenDo();
}

