function narrowHistory() {
    var self = this;
    var candidates = this.historyAsItems();
    var curIdx,  current = candidates.detect(function(ea, i) { curIdx = i; return ea.string.startsWith("->"); });
    Functions.composeAsync(
      function(next) {
        lively.ide.tools.SelectionNarrowing.getNarrower({
            name: "clojure.ide.SystemBrowserHistory",
            spec: {
                prompt: 'select item: ',
                preselect: current && curIdx,
                candidates: candidates,
                actions: [{
                  name: 'with item do',
                  exec: function(candidate) { next(null, candidate); }
                }]
            }
        })
      },
      function(c, next) {
        self.currentHistoryNavItem = c;
        self.historyNavigate(c, false, next);
    })(function(err) { /*all done*/ });
}

