function historyAsItems() {
    var self = this;
    return this.navigationHistory.map(function(ea, i) {
      var printed = ea.ns + (ea.nsIntern ? "/" + ea.nsIntern : "");
      var navItem = self.navigationHistory[i];
      printed = self.currentHistoryNavItem === ea ?
        ("-> " + printed) : lively.lang.string.pad(printed, 3, true);
      return {isListItem: true, string: printed, value: navItem};
    }).reverse();
}

