function loadProjectInteractively() {

  var cwd = lively.shell.exec('pwd', {sync:true}).resultString();    
  var e = this.get("CodeEditor"), dir, self = this, report;

  lively.lang.fun.composeAsync(
    deselect,
    chooseDir,
    setCwd,
    loadDependencies,
    loadProjectAndFetchNamespaces,
    chooseNamespacesToRequire,
    requireNamespaces,
    reload,
    select
  )(function(err) {
    if (err) return self.showClojureError(err, "Error loading project" + (dir ? " " + dir : ""));
    e.setStatusMessage(report || "Successfully loaded project " + dir)
  })

  // -=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-

  function deselect(n) {
    self.saveScheduleSelection(null,null,true, n)
  }

  function chooseDir(n) {
    lively.ide.CommandLineSearch.interactivelyChooseFileSystemItem(
      'choose directory: ', cwd,
      function(files) { return files.filterByKey('isDirectory'); },
      "clojure.addDir.NarrowingList", [
        function loadClojureNamespaceFiles(_dir) { dir = _dir; n(null, dir); }
      ]);
  }

  function setCwd(dir, n) { lively.shell.setWorkingDirectory(dir.path || dir); n(null, dir); }

  function loadDependencies(dir, n) {
    var code = lively.lang.string.format(
      '(clojure.data.json/write-str (rksm.system-navigator.dependencies/load-deps-from-project-clj-or-pom-in "%s"))', dir);
    Global.clojure.Runtime.doEval(code,
      {requiredNamespaces: ['clojure.data.json', 'rksm.system-navigator.dependencies'],
       passError: true, resultIsJSON: true}, function(err, result) { n(err, dir); });
  }

  function loadProjectAndFetchNamespaces(dir, n) {
    var code = lively.lang.string.format(
      '(clojure.data.json/write-str (rksm.system-navigator.ns.filemapping/add-project-dir "%s"))', dir);
    Global.clojure.Runtime.doEval(code,
      {requiredNamespaces: ['clojure.data.json', 'rksm.system-navigator.ns.filemapping'],
       passError: true, resultIsJSON: true}, n);
  }

  function chooseNamespacesToRequire(nsList, n) {
    $world.editPrompt("What namespaces to load?", function(textlistOfNs) {
      if (!textlistOfNs) {
        show("requiring no namespaces for\n" + dir);
        n(null, []);
      } else {
        var nss = lively.lang.string.lines(textlistOfNs).invoke("trim").compact();
        n(null, nss);
      }
    }, nsList.sortByKey("length").join("\n"));
  }

  function requireNamespaces(nss, n) {
    var code = nss.map(function(ns) { return "(require '" + ns + " :reload)"; }).join("\n");
    Global.clojure.Runtime.doEval(code, {passError: true, ns: 'user'}, function(err) { n(err, nss); });
  }

  function reload(nss, n) { self.reload({namespaces: nss || []}, function(err) { n(err, nss); }); }


  function select(nss, n) {
    if (!nss || !nss.length) return n();
    // self.saveScheduleSelection(nss[0], null, true, n);
    (function() {
      self.scheduleSelection(nss[0], null, true, n);
    }).delay(.2);
    // this.saveScheduleSelection(nss[0], null, true, n);
  }
}

